function Notfround(props) {
    const style = {
        height : '100vh',
        width : '100vw',
        textAlign : "center",
        paddingTop : ":20%"
    }
    return (
        <div className="h1" style={style}>
            oops <br/>
            error in loading
        </div>
    );
}

export default Notfround;
